import {Component} from 'react'
export default class AddFood extends Component{
    // פונקציה לעריכת הקוד
    sateid(e){
this.setState({id:e.target.value})
    }
    satename(e){
        this.setState({name:e.target.value})
            }
    constructor(props){
        debugger
        super(props)
        this.state={
            id:0,
            name:'',
            pric:0

        }
    }
render(){
    return  <form>
    
        <input type="number" placeholder='הכנס קוד' onChange={(e)=>this.sateid(e)}></input><br></br>
        <input type="text" placeholder='הכנס שם' onChange={(e)=>this.satename(e)}></input><br></br>
        <input type="number" placeholder='הכנס מחיר' onChange={(e)=>this.setState({pric:e.target.value})}></input><br></br>
        {/* הצגת תוכן הסטיט */}
        <p>
            {this.state.id}-----{this.state.name}------{this.state.pric}
        </p>
        <button  onClick={()=>this.props.onadd({id:this.state.id,name:this.state.name,price:this.state.pric})}>הוסף</button>
    </form>
}
}
